import React from 'react'

const options = {
	method: 'GET',
	headers: {
		'X-RapidAPI-Key': '66e8119c22msh3fad4b9ccde6f89p1683b1jsn81473db9586a',
		'X-RapidAPI-Host': 'api-football-v1.p.rapidapi.com'
	}
};

var data_to_print = fetch('https://api-football-v1.p.rapidapi.com/v3/standings?season=2020&league=39', options)
	.then(response => response.json())
	.then(response => console.log(response))
	.catch(err => console.error(err));

function App() {

  return(
    <div className = "App">
      {JSON.stringify(data_to_print)}
    </div>
    )
}

export default App;
